		// 		<a className='nav-link ' onClick={(e) => props.handleClick(e)} id='AdminPage'>
		// 			Admins
		// 		</a>
		// 	</li>
		// 	<li
		// 		className='p-0 m-0 list-group-item custom-side-bar-li'
		// 		style={activeComponent === 'ProductPage' ? activeDisplay : null}
		// 	>
		// 		<a className='nav-link ' onClick={(e) => props.handleClick(e)} id='ProductPage'>
		// 			Products
		// 		</a>
		// 	</li>
