		// 		className='p-0 m-0 list-group-item custom-side-bar-li'
		// 		style={activeComponent === 'CategoryPage' ? activeDisplay : null}
		// 	>
		// 		<a className='nav-link ' onClick={(e) => props.handleClick(e)} id='CategoryPage'>
		// 			Categories
		// 		</a>
		// 	</li>
		// </ul>
   <List
			component='nav'
			aria-labelledby='nested-list-subheader'
			subheader={(
    <ListSubheader component='div' id='nested-list-subheader'>
					Dashboard
				</ListSubheader>
  )}
			className={classes.root}
   >
     {/* start li  */}
			<ListItem button onClick={(e) => props.handleClick(e)} id='Dashboard' style={activeComponent === 'Dashboard' ? activeDisplay : null}>
				<ListItemIcon>
					<SendIcon />
				</ListItemIcon>

		 		<ListItemText primary='Dashboard'></ListItemText>

			</ListItem>
      {/* end li */}
       {/* start li  */}
			<ListItem onClick={(e) => props.handleClick(e)} id='UserPage' style={activeComponent === 'UserPage' ? activeDisplay : null}>
				<ListItemIcon>
					<SendIcon />
				</ListItemIcon>  
		 		<ListItemText primary='UserPage'></ListItemText>
			</ListItem>
      {/* end li */}
       {/* start li  */}
			<ListItem onClick={(e) => props.handleClick(e)} id='AdminPage' style={activeComponent === 'AdminPage' ? activeDisplay : null}>
				<ListItemIcon>
					<SendIcon />
				</ListItemIcon>
		 		<ListItemText primary='AdminPage'></ListItemText>
			</ListItem>
      {/* end li */}
       {/* start li  */}
			<ListItem onClick={(e) => props.handleClick(e)} id='ProductPage' style={activeComponent === 'ProductPage' ? activeDisplay : null}>
				<ListItemIcon>
					<SendIcon />
				</ListItemIcon>

		 		<ListItemText primary='ProductPage'></ListItemText>

			</ListItem>
      {/* end li */}
       {/* start li  */}
			<ListItem onClick={(e) => props.handleClick(e)} id='CategoryPage' style={activeComponent === 'CategoryPage' ? activeDisplay : null}>
				<ListItemIcon>
					<SendIcon />
				</ListItemIcon>

		 		<ListItemText primary='CategoryPage'></ListItemText>

			</ListItem>
      {/* end li */}
			<ListItem button style={activeComponent === 'ProductPage' ? activeDisplay : null}>
				<ListItemIcon>
					<DraftsIcon />
				</ListItemIcon>
				<Link className='font-bold text-black text-decoration-none ' to='/admin/all-users'>

					<ListItemText primary='All Users'></ListItemText>
				</Link>
			</ListItem>
			<ListItem button onClick={handleClick}>
				<ListItemIcon>
					<InboxIcon />
				</ListItemIcon>
				<ListItemText primary='Results' />
				{open ? <ExpandLess /> : <ExpandMore />}
			</ListItem>
			<Collapse in={open} timeout='auto' unmountOnExit>
				<List component='div' disablePadding>
					<ListItem button className={classes.nested}>
						<ListItemIcon>
							<StarBorder />
						</ListItemIcon>
						<Link className='font-bold text-black text-decoration-none ' to='/admin/all-questions'>

					<ListItemText primary='All Results'></ListItemText>
				</Link>
					</ListItem>
				</List>
			</Collapse>
		</List>
	);
}
